SELECT 
    COUNT(status),status,COUNT(service), service, MIN(event_time) AS FIRST_ELEMENT, MAX(event_time) AS LAST_ELEMENT
FROM
    stack_db.event
WHERE
    event_time > '2021-08-20 14:19:00.000000'
        AND event_time < '2021-08-20 15:01:00.000000'
        AND status IN ('COMPLETED','PROCESSING','ACCEPTING')
GROUP BY service,status;	

    
